				       TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_rpbgetresp(Rest, 0, 0, F1, F2, F3,
				       TrUserData);
	    1 ->
		skip_64_rpbgetresp(Rest, 0, 0, F1, F2, F3, TrUserData);
