				     Rest/binary>>,
				   N, Acc, F1, F2, F3, F4, F5, F6,
				   TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_rpbcountergetreq_bucket(Rest, 0, 0, F1, F2, F3,
					  F4, F5, F6, TrUserData);
      18 ->
	  d_field_rpbcountergetreq_key(Rest, 0, 0, F1, F2, F3, F4,
